import React from "react";

function Item({name, description, image, onItemDelete, id}){
    console.log(image)
    return (
        <div id="item">
            <h1>{name}</h1>
            <p>{description}</p>
            <img src={image} alt={name} height="400px" width="400px"/><br />
            <button onClick={() => onItemDelete(id)}>DELETE</button>
        </div>
    )
}


export default Item
